pages:
- content: Welcome to image similarity evaluation. <br/> <br/> We do not ask any personal details of you, so your answers will be saved fully anonymised. <br/> <br/> The objective of this evaluation is to compare the <b>visual quality</b> between <b>two</b> filtered images. <br /> <br/> You will be presented a pair of filtered images as well as the original image in each page. <br /> Each pair of images will be displayed for <b>4 seconds</b>. <br />  You will be required to answer by <b>Yes</b> or <b>No</b> to the question of <br /> <b>Are there any differences between these two filtered images?</b>. <br /> <br /> In total, you will be presented 121 pages (takes less than 10 minutes), 120 image pairs and one last page to click on sending your results. <br /> Please do <b>not</b> use your mobile phone. 
  id: first_page
  name: Welcome
  type: generic
